var $bm_rt;
var freq, amp, loopTime, t, wiggle1, wiggle2;
freq = 0.5;
amp = 50;
loopTime = 4;
t = $bm_mod(time, loopTime);
wiggle1 = wiggle(freq, amp, 1, 0.5, t);
wiggle2 = wiggle(freq, amp, 1, 0.5, $bm_sub(t, loopTime));
$bm_rt = linear(t, 0, loopTime, wiggle1, wiggle2);

s.x:
var $bm_rt;
var maxDev, spd, decay, t, x, y;
maxDev = 2;
spd = 2;
decay = 0;
t = $bm_sub(time, inPoint);
x = $bm_sum($bm_transform.scale[0], $bm_div($bm_mul(maxDev, Math.sin($bm_mul(spd, t))), Math.exp($bm_mul(decay, t))));
y = $bm_div($bm_mul($bm_transform.scale[0], $bm_transform.scale[1]), x);
$bm_rt = [
    x,
    y
];
